webpackJsonp([22],{137:function(n,i,t){"use strict";Object.defineProperty(i,"__esModule",{value:!0});var e=t(65),s=t.n(e),o=t(66),r=t.n(o),h=t(67),f=t.n(h),u=t(68),m=t.n(u),a=t(69),c=t.n(a),l=t(265),d=(t(432),t(267),function(n){function i(){return r()(this,i),m()(this,(i.__proto__||s()(i)).apply(this,arguments))}return c()(i,n),f()(i,[{key:"document",value:function(){return t(434)}}]),i}(l.a));i.default=d},432:function(n,i,t){"use strict";var e=t(433);t.n(e),t(284),t(267),t(270)},433:function(n,i){},434:function(n,i){n.exports='## Confirm 确认框\n\n用于重要操作的确认提示。\n\n### 基本用法\n\n弹窗形式，默认有取消和确定两个按钮。\n\n::: demo\n```js\n  constructor(props) {\n    super(props);\n    this.state = {\n      visible: false,\n    };\n    this.showConfirm = this.showConfirm.bind(this);\n    this.hideConfirm = this.hideConfirm.bind(this);\n  }\n\n  showConfirm() {\n    this.setState({\n      visible: true,\n    });\n  }\n\n  hideConfirm() {\n    this.setState({\n      visible: false,\n    });\n  }\n\n  render() {\n    const { visible } = this.state;\n    return (\n      <div>\n        <Button theme="error" onClick={this.showConfirm}>删除</Button>\n        <Confirm\n          visible={visible}\n          onOk={this.hideConfirm}\n          onCancel={this.hideConfirm}\n          message=\'确认删除吗？\'\n        />\n      </div>\n    );\n  }\n```\n:::\n\n### 自定义操作按钮\n\n自定义操作按钮的文案。\n\n::: demo 通过`okText`, `cancelText`属性设置。\n```js\n  constructor(props) {\n    super(props);\n    this.state = {\n      visible: false,\n    };\n    this.showConfirm = this.showConfirm.bind(this);\n    this.hideConfirm = this.hideConfirm.bind(this);\n  }\n\n  showConfirm() {\n    this.setState({\n      visible: true,\n    });\n  }\n\n  hideConfirm() {\n    this.setState({\n      visible: false,\n    });\n  }\n\n  render() {\n    const { visible } = this.state;\n    return (\n      <div>\n        <Button theme="info" onClick={this.showConfirm}>自定义操作按钮</Button>\n        <Confirm\n          visible={visible}\n          okText="继续"\n          cancelText="返回"\n          onOk={this.hideConfirm}\n          onCancel={this.hideConfirm}\n          message=\'继续操作吗？\'\n        />\n      </div>\n    );\n  }\n```\n:::\n\n\n### Attributes\n| 参数      | 说明          | 类型      | 可选值                           | 默认值  |\n|---------- |-------------- |---------- |--------------------------------  |-------- |\n| message | 内容文本 | string | — | \'\' |\n| width | 弹窗宽度 | number | — | 270 |\n| okText | 确认按钮文本 | string | — | 确认 |\n| cancelText | 取消按钮文本 | string | — | 取消 |\n\n\n### Events\n| 事件名称 | 说明 | 回调参数 |\n|---------- |-------- |---------- |\n| onOk | 点击确认触发的事件 | — |\n| onCancel | 点击取消触发的事件 | — |\n'}});